ప్రస్తుత ట్యాబ్‌లో ప్లే అవుతున్న పాటను గుర్తించడానికి AudD పొడిగింపును ఇన్‌స్టాల్ చేసి, దాని చిహ్నంపై క్లిక్ చేయండి.
ఇది ఎలా పని చేస్తుందో చూడటానికి పై వీడియోను చూడండి.

AudD పొడిగింపు:
- మీ బ్రౌజర్‌లో ప్లే అవుతున్న సంగీతాన్ని గుర్తిస్తుంది;
- సంగీత గుర్తింపు సాంకేతికతను ఉపయోగించి 75 మిలియన్ కంటే ఎక్కువ పాటలతో AudD డేటాబేస్‌లో సంగీతాన్ని కనుగొంటుంది;
- గుర్తించబడిన పాటల కోసం సాహిత్యాన్ని చూపుతుంది;
- Apple Music, Spotify, Deezer, YouTube Musicలో పాటలను వినడానికి లింక్‌లను చూపుతుంది;
- బ్రౌజర్ నుండి ధ్వని ప్లే చేయబడినప్పుడు గుర్తించబడిన పాటలో ఖచ్చితమైన క్షణాన్ని ప్రదర్శిస్తుంది.

సంగీత గుర్తింపు API: https://audd.io
సోర్స్ కోడ్: https://github.com/AudDMusic/chrome-extension

పొడిగింపు AudD® సంగీత గుర్తింపు API ద్వారా ఆధారితం

ఎరిక్ స్టార్క్, మిచెల్ కోసోరిస్ మరియు ఇవాన్ కసట్కిన్ సహాయంతో AudD.io బృందం రూపొందించింది మరియు రూపొందించబడింది.
